import {Context, Event} from "../../../lib/serverless-lib.js";
import { handler as uploadHandler } from '../../../lambda/templates/template-upload.js';
import { handler as renderIdHandler } from '../../../lambda/templates/template-render-id.js';
import * as fs from "fs";
import os from "os";
import {logger} from "../../../lib/logger-lib.js";
import {unixTimestamp} from "../../../lib/utils-lib.js";
process.env.LOG_LEVEL = 'off';

// We don't want to mock the AWS SDK for these tests
// Since we need to store and upload data, we need to use the real AWS SDK (but on the local system)

jest.mock('aws-sdk', () => {
    const S3Mocked = {
        putObject: jest.fn().mockReturnThis(),
        deleteObject: jest.fn().mockReturnThis(),
        getObject: jest.fn().mockReturnThis(),
        promise: jest.fn()
    };
    return {
        S3: jest.fn(() => S3Mocked)
    };
});

let templateFileBase64 = '                                                                                                            ';

/**
 * Happy Path - upload and render a basic template
 */
test('template-render-id - upload and render a basic template', async () => {
    let event = new Event();
    event.requestContext = {
        authorizer: {
            claims: {
                username: 'foo'
            }
        }
    };
    let context = new Context();

    // Set the JSON body
    event.body = Buffer.from(templateFileBase64, 'base64').toString();

    event.headers = {
        'Content-Type': 'multipart/form-data; boundary=--------------------------379267802631926676897329',
        Accept: 'application/json',
        Authorization: 'Bearer eyJhbGciOiJIUzI1NiJ9.eyJpZCI6MSwidXNlcm5hbWUiOiJmb28iLCJyb2xlIjoiQURNSU4iLCJ0b2tlbiI6IiIsInJlYWxtX2FjY2VzcyI6eyJyb2xlcyI6WyJhcHBfYWRtaW4iXX0sInNjb3BlIjoiZW1haWwgcHJvZmlsZSIsImVtYWlsX3ZlcmlmaWVkIjp0cnVlLCJwcmVmZXJyZWRfdXNlcm5hbWUiOiJmb28iLCJleHAiOjE3MTAxMTIxNTd9.5fYGmWV_zVP0-bjFSIwPlZgVseiH4ka1AoEyZMTi_Y0',
        'User-Agent': 'PostmanRuntime/7.36.1',
        'Cache-Control': 'no-cache',
        'Postman-Token': '50298861-ef6c-4995-909d-8ef47666d55e',
        Host: 'localhost:3500',
        'Accept-Encoding': 'gzip, deflate, br',
        Connection: 'keep-alive',
        'Content-Length': '17242'
    }

    // Call our method
    let result = await uploadHandler(event, context);

    expect(result.statusCode).toEqual(200);

    // Add the path parameter to delete the correct id
    let renderIdEvent = new Event();
    let renderIdContext = new Context();
    renderIdEvent.body = JSON.stringify({
        "data":{
            "firstName": "Ben",
            "lastName": "Inkster",
            "companyName":"JohnInsurance & Co",
            "period":2,
            "sD":1659041229,
            "id":2891,
            "insured":{
                "name":"Jean Michel",
                "street":"23, Sycamore Street",
                "city":"New York",
                "phone":"+33 2 38 99 18 23"
            },
            "showPropertyDamage":false,
            "propertyDamage":[
                {
                    "type":"Fire"
                },
                {
                    "type":"Wind"
                },
                {
                    "type":"Hail"
                },
                {
                    "type":"Water"
                }
            ],
            "options":[
                {
                    "type":"Furniture",
                    "note":"/",
                    "cost":1200
                },
                {
                    "type":"Appliances",
                    "note":"/",
                    "cost":400
                },
                {
                    "type":"Clothing",
                    "note":"/",
                    "cost":300
                },
                {
                    "type":"Dishes",
                    "note":"in some cases",
                    "cost":300
                }
            ],
            "optionsTotalHT":2200,
            "optionsTaxes":10,
            "optionsTotal":2420
        },
        "formatters": "{\"myFormatter\":\"_function_myFormatter|function(data) { return data.slice(1); }\",\"myOtherFormatter\":\"_function_myOtherFormatter|function(data) {return data.slice(2);}\"}",
        "options": {
            "convertTo": "pdf",
            "overwrite": true,
            "reportName": "abc_123_{firstName}_{lastName}"
        }

    });
    renderIdEvent.pathParameters = {
        uid: (JSON.parse(result.body))[0].carbone_id
    };
    renderIdEvent.requestContext = {
        authorizer: {
            claims: {
                username: 'foo'
            }
        }
    };

    // call delete method
    let renderIdResult = await renderIdHandler(renderIdEvent, renderIdContext);

    // Save file to temporary directory
    try {
        const timestamp = unixTimestamp();
        const tempDir = os.tmpdir();
        const tempFilePath = `${tempDir}/${timestamp}-${renderIdResult.headers['X-Report-Name']}`;
        await fs.writeFileSync(tempFilePath, renderIdResult.body, 'base64');
    } catch (err) /* istanbul ignore next */ {
        await logger.error('template-upload.process_file() - fs.writeFileSync exception with error: ' + err);
        throw new Error(err);
    }

    // Check the response
    expect(renderIdResult.statusCode).toBe(200);
});
